INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 1, 0, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 125801, 1, 321, 40011, 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 2, 0, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 126001, 1, 322, 40011, 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 3, 0, "プレシア", "んーと。\nこれ、あげる。\nはい", 24001, 126101, 1, 323, 40011, 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 4, 0, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 125801, 2, 324, 40011, 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 5, 0, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 126001, 2, 325, 40011, 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 6, 0, "プレシア", "お兄。\nきてくれて、うれしい", 24001, 126101, 2, 326, 40011, 2);
